# @lc code=start
from typing import List


def bisect_closest_upper(x, arr, begin = 0, end = None):
    if end is None:
        end = len(arr)
    pivot = (end + begin) // 2
    if arr[pivot] == x:
        return pivot
    if arr[pivot] < x:
        if pivot == end - 1:
            return None
        return bisect_closest_upper(x, arr, pivot + 1, end)
    if pivot == begin:
        return pivot
    r = bisect_closest_upper(x, arr, begin, pivot)
    return pivot if r is None else r


class Solution:
    def fullBloomFlowers(self, flowers: List[List[int]], persons: List[int]) -> List[int]:
        unique_moments = self.index_moments(flowers)
        unique_moments_lookup = { unique_moments[i] : i for i in range(len(unique_moments)) }
        # print(unique_moments_lookup)
        flower_overlap = [0] * len(unique_moments)
        for b, e in flowers:
            for i in range(unique_moments_lookup[b], unique_moments_lookup[e] + 1):
                flower_overlap[i] += 1
        # print(flower_overlap)

        results = self.count_bloomers(persons, unique_moments, flower_overlap)

        return results

    def count_bloomers(self, persons, unique_moments, flower_overlap):
        results = []

        for p in persons:
            upper_moment = bisect_closest_upper(p, unique_moments)
            if upper_moment is None:
                results.append(0)
            else:
                results.append(flower_overlap[upper_moment])
        return results

    def index_moments(self, flowers):
        unique_moments = set()
        for b, e in flowers:
            unique_moments.update([b - 1, b, e])
        unique_moments = sorted(x for x in unique_moments)
        return unique_moments


